import { BsLink45Deg } from "react-icons/bs";
import classes from "./Contact.module.css";

const ContactLink = (props) => {
  return (
    <div>
      <a href={props.link}>
        {props.icon}
        <p>{props.name}</p>
        <BsLink45Deg className={classes["anchor-icon"]} />
      </a>
    </div>
  );
};

export default ContactLink;
